import { HttpClient } from '@angular/common/http';
import { Component, OnInit } from '@angular/core';
import { ParticipantesModalComponent } from 'src/app/participantes-modal/participantes-modal.component';
import { GeneralService } from 'src/app/servicios/general.service';
import { SemanasService } from 'src/app/servicios/semanas.service';
import { ModalController } from '@ionic/angular';
import { PrestamoService } from 'src/app/servicios/prestamo.service';
import { ParticipantesService } from 'src/app/servicios/participantes.service';
import pdfmake from 'pdfmake/build/pdfmake';
import pdfFonts from 'pdfmake/build/vfs_fonts';
pdfmake.vfs = pdfFonts.pdfMake.vfs;
import { Filesystem, Directory } from '@capacitor/filesystem';

@Component({
  selector: 'app-semanal',
  templateUrl: './semanal.page.html',
  styleUrls: ['./semanal.page.scss'],
})
export class SemanalPage implements OnInit {
  filas: any[] = [];
  prestamistas: any[] = [];

  constructor(
    private semanasService: SemanasService,
    private modalController: ModalController,
    private prestamoService: PrestamoService,
    private participantesService: ParticipantesService,
    private servG: GeneralService
  ) {}

  ngOnInit() {
    this.cargarDatos();
  }

  cargarDatos() {
    this.semanasService.conseguirDatosSemanas().subscribe(
      (response: any) => {
        if (response.data) {
          let saldoAcumulado = 0;
          let almacenandoPrestamos = 0;
    
          this.filas = response.data.map((dato: any) => {
            const totalprestamos = dato.totalprestamos === null ? 0 : parseFloat(dato.totalprestamos);
            const prestamosPagado = dato.prestamospagado === null ? 0 : parseFloat(dato.prestamospagado);
            const totalInteres = dato.totalinteres === null ? 0 : dato.totalinteres;
            
            almacenandoPrestamos += prestamosPagado;
            saldoAcumulado = parseFloat(dato.saldoanterior) + almacenandoPrestamos;

            return {
              Semana: dato.semana,
              TotalSemana: dato.totalsemana,
              TotalPrestamos: totalprestamos,
              totalinteres: totalInteres,
              prestamoscancelado: prestamosPagado,
              SaldoAnterior: saldoAcumulado,
              Participantes: [],
              expand: false
            };
          });
    
          this.listarPrestamistas();
        }
      },
      (error) => {
        console.error('Error al cargar los datos', error);
      }
    );
  }

  listarPrestamistas() {
    this.prestamoService.listarPrestamismas().subscribe(
      (response: any) => {
        if (response.data) {
          this.filas.forEach(fila => {
            fila.Participantes = response.data
              .filter((dato: any) => dato.pp_semana === fila.Semana)
              .map((dato: any) => ({
                participante: dato.pp_partId,
                prestamo: dato.pp_prestamo,
                interes: dato.interes,
                fecha_pago: dato.fecha_pago,
                estado: dato.estado
              }));
          });

          this.filas.forEach(fila => this.buscarNombreParticipante(fila.Participantes));
        }
      },
      (error) => {
        console.error('Error al listar los prestamistas', error);
      }
    );
  }

  buscarNombreParticipante(participantes: any[]) {
    participantes.forEach(participante => {
      this.participantesService.obtenerCuposParticipante(participante.participante).subscribe(
        (response: any) => {
          if (response.data) {
            participante.participante = response.data.part_nombre;
          }
        },
        (error) => {
          console.error('Error al cargar los nombres de los participantes', error);
        }
      );
    });
  }

  async openParticipantesModal(row: any) {
    const modal = await this.modalController.create({
      component: ParticipantesModalComponent,
      componentProps: {
        data: row
      }
    });
    return await modal.present();
  }

  async downloadNewPdf() {
    const pdfContent = await this.generateNewPdfContent();
    await this.savePdfToFileSystem(`reporte_semanal.pdf`, pdfContent);
  }

  private generateNewPdfContent(): Promise<Uint8Array> {
    const docDefinition = {
      content: [
        {
          text: 'Reporte Semanal',
          style: 'header'
        },
        {
          style: 'tableExample',
          table: {
            widths: ['*', 'auto', 'auto', 'auto', 'auto', 'auto'],
            body: [
              [
                { text: 'Semana', bold: true },
                { text: 'T. Semana', bold: true },
                { text: 'T. Prestamos', bold: true },
                { text: 'T. Intereses', bold: true },
                { text: 'PrÃ©st. Pag.', bold: true },
                { text: 'Saldo', bold: true }
              ],
              ...this.filas.map((fila) => [
                fila.Semana,
                fila.TotalSemana,
                fila.TotalPrestamos,
                fila.totalinteres,
                fila.prestamoscancelado,
                fila.SaldoAnterior
              ])
            ]
          },
          layout: 'lightHorizontalLines'
        }
      ],
      images: {
        logo: 'data:image/png;base64,'
      },
      background: [
        {
          image: 'logo',
          width: 400, // Ajusta el tamaÃ±o del logo aquÃ­
          height: 400, // Ajusta el tamaÃ±o del logo aquÃ­
          opacity: 0.3, // Ajusta la opacidad del logo aquÃ­
          margin: [0, 200, 0, 0],
          alignment: 'center',
          angle: 0
        }
      ],styles: {
        header: { fontSize: 18, bold: true, alignment: 'center', margin: [0, 0, 0, 10] },
        subheader: { fontSize: 14, bold: true, margin: [0, 10, 0, 5] },
        tableExample: { margin: [0, 5, 0, 15] }
      },
    };
  
    return new Promise<Uint8Array>((resolve, reject) => {
      pdfmake.createPdf(docDefinition).getBuffer((buffer: Uint8Array) => {
        resolve(buffer);
      });
    });
  }

  private arrayBufferToBase64(buffer: Uint8Array): string {
    let binary = '';
    const bytes = new Uint8Array(buffer);
    for (let i = 0; i < bytes.byteLength; i++) {
      binary += String.fromCharCode(bytes[i]);
    }
    return window.btoa(binary);
  }

  private async savePdfToFileSystem(fileName: string, pdfData: Uint8Array) {
    try {
      const base64Data = this.arrayBufferToBase64(pdfData);
  
      await Filesystem.writeFile({
        path: fileName,
        data: base64Data,
        directory: Directory.Documents
      });
      this.servG.fun_Mensaje('PDF guardado exitosamente en el sistema de archivos.');
      console.log('PDF guardado exitosamente en el sistema de archivos.');
    } catch (error) {
      this.servG.fun_Mensaje('Error al guardar el PDF en el sistema de archivos.');
      console.error('Error al guardar el PDF en el sistema de archivos:', error);
    }
  }
}
